public class L1011ShipWithinDDays {

    public static void main(String[] args) {
        new L1011ShipWithinDDays().run();
    }

    public void run(){
        System.out.println(shipWithinDays2(new int[]{1,1,1,1,1,1,1,1}, 1));
    }

    public int shipWithinDays(int[] weights, int days) {
        int count = days+1;
        int minCost = 1;

        for( int i = 0; i < weights.length; i++ ){
            minCost = Math.max(minCost, weights[i]);
        }

        while( count > days ){
            count = 1;
            int sum = 0;

            for( int i = 0; i < weights.length; i++ ){
                if( sum+weights[i] <= minCost ) sum += weights[i];
                else {
                    count++;
                    sum = weights[i];
                }
            }

            minCost++;
        }

        return minCost-1;
    }

    public int shipWithinDays2(int[] weights, int days) {
        // int count = days+1;
        int minCost = 1;
        int maxCost = 0;


        for( int i = 0; i < weights.length; i++ ){
            minCost = Math.max(minCost, weights[i]);
            maxCost += weights[i];
        }

        int lastWorkedCost = maxCost;

        while( minCost < maxCost ){
            int currCost = (minCost+maxCost)/2;
            if( works(weights, days, currCost) ) {
                lastWorkedCost = maxCost = currCost;
            }
            else {
                minCost = currCost+1;
            }
        }

        return lastWorkedCost;
    }

    boolean works(int[] weights, int days, int minCost){
        int count = 1;
        int sum = 0;

        for( int i = 0; i < weights.length; i++ ){
            if( sum+weights[i] <= minCost ) sum += weights[i];
            else {
                count++;
                if( count > days ) break;
                sum = weights[i];
            }
        }

        return count <= days;
    }
}
